            "type": "string",
            "format": "date",
            "x-example": "2019-05-17"
          },
          {
            "name": "lang",
            "in": "query",
            "description": "Language enumeration; default value: CZ",
            "required": false,
            "type": "string",
            "enum": [
              "CZ",
              "EN"
            ]
          }
        ],
        "responses": {
          "200": {
            "description": "Ok",
            "schema": {
              "$ref": "#/definitions/ExRateDailyResponse"
            }
          },
          "400": {
            "description": "Bad Request",
